INSERT INTO public.vocabulary (vocabulary_id, vocabulary_name, vocabulary_reference, vocabulary_version, vocabulary_concept_id) VALUES ('APOLLO_SV', 'Defines terms and relations necessary for interoperation between epidemic models and public health application software that interface with these models', 'http://code.google.com/p/apollo/', '2017-09-22', -8999976);
INSERT INTO public.vocabulary (vocabulary_id, vocabulary_name, vocabulary_reference, vocabulary_version, vocabulary_concept_id) VALUES ('STATO', LEFT('STATO is a general-purpose STATistics Ontology. Its aim is to provide coverage for processes such as statistical tests, their conditions of application, and information needed or resulting from statistical methods, such as probability distributions, variables, spread and variation metrics. STATO also covers aspects of experimental design and description of plots and graphical representations commonly used to provide visual cues of data distribution or layout and to assist review of the results.', 255), 'http://stato-ontology.org/', '2017-09-22', -8999975);
